import React from 'react'
import styled from 'styled-components'

const Wrapper =styled.div`
ul{
    margin:5vh 0;
    padding:0;
}
li{
    list-style:none;
    padding:5vh 0;
    margin:0;
}
a{
    text-decoration:none;
    color:#fff;
    &:hover{
        color:#07BDF6,;
    }
}
`



const SideBar = () => {
    return (
        <Wrapper>
            <ul>
                <li><a href="">Experiences</a></li>
                <li><a href="">Who I am</a></li>
                <li><a href="">Contact Me</a></li>
            </ul>
        </Wrapper>
    )
}

export default SideBar
